l:attribute><xsl:if test=\"./text()\"><div id=\"layoutCell25114\" class=\"cell  cellBussiness  textJustify\" ><xsl:attribute name=\"id\">layoutCell25114<xsl:text>_Repeating_</xsl:text><xsl:number level=\"any\" format=\"1\"/></xsl:attribute><xsl:call-template name=\"lbl_Poznamka1\"></xsl:call-template><div class=\"clear\">&#xa0;</div></div></xsl:if><xsl:if test=\"./text()\"><div id=\"layoutCell25115\" class=\"cell  cellBussiness  textJustify trochuMensiText\" ><xsl:attribute name=\"id\">layoutCell25115<xsl:text>_Repeating_</xsl:text><xsl:number level=\"any\" format=\"1\"/></xsl:attribute><xsl:call-template name=\"lbl_Poznamka2\"></xsl:call-template><div class=\"clear\">&#xa0;</div></div></xsl:if><xsl:if test=\"./text()\"><div id=\"layoutCell25116\" class=\"cell  cellBussiness  textJustify trochuMensiText\" ><xsl:attribute name=\"id\">layoutCell25116<xsl:text>_Repeating_</xsl:text><xsl:number level=\"any\" format=\"1\"/></xsl:attribute><xsl:call-template name=\"lbl_Poznamka3\"></xsl:call-template><div class=\"clear\">&#xa0;</div></div></xsl:if></div><div class=\"clear\">&#xa0;</div></div></div></xsl:template><xsl:template name=\"lbl_Poznamka1\"><span class=\"fieldLabel\" title=\"\"   style=\"width:870px;\"><xsl:text disable-output-escaping=\"yes\">K návrhu na vykonanie exekúcie na podklade cudzieho exekučného titulu je potrebné pripojiť aj listiny uvedené v osobitnom predpise.&lt;sup&gt;1)&lt;/sup&gt; Ak sa podľa osobitného predpisu vyžaduje rozhodnutie o vyhlásení vykonateľnosti &lt;sup&gt;2)&lt;/sup&gt; alebo o uznaní &lt;sup&gt;3)&lt;/sup&gt; ako podmienka výkonu cudzieho exekučného titulu, je potrebné pripojiť aj rozhodnutie súdu o uznaní alebo o vyhlásení vykonateľnosti tohto cudzieho exekučného titulu. Ak bol exekučný titul osvedčený podľa osobitného predpisu a ako podmienka jeho výkonu sa nevyžaduje rozhodnutie súdu o jeho vykonateľnosti, je potrebné pripojiť osvedčenie podľa tohto osobitného predpisu. &lt;sup&gt;4)&lt;/sup&gt;</xsl:text></span><div class=\"fieldContent\"><div class=\"HtmlVisualizationWithDiv contentVis wordwrap\"></div></div></xsl:template><xsl:template name=\"lbl_Poznamka2\"><span class=\"fieldLabel\" title=\"\"   style=\"width:870px;\"><xsl:text disable-output-escaping=\"yes\">1) Napríklad § 47 zákona č.244/2002 Z. z. v znení neskorších predpisov&lt;br/&gt; 2) Napríklad nariadenie Rady (ES) č.44/2001 z 22. decembra 2000 o právomoci a o uznávaní a výkone rozsudkov v občianskych a obchodných veciach (Ú.v. ES L12, 16. 1. 2001), nariadenie Rady (ES) č.4/2009 z  18. decembra 2008 o právomoci, rozhodnom práve, uznávaní a výkone rozhodnutí a o spolupráci vo veciach vyživovacej povinnosti (Ú.v. EÚ L7, 10. 1. 2009) v prípade rozhodnutia vydaného v členskom štáte, ktorý nie je viazaný Haagskym protokolom z roku 2007, nariadenie (ES) č.650/2012 z júla 2012 o právomoci, rozhodnom práve, uznávaní a výkone verejných listín v dedičských veciach a o zavedení európskeho osvedčenia o dedičstve, Lugánsky dohovor zo 16. septembra 1988 o právomoci a výkone rozsudkov v občianskych a obchodných veciach, ktorým sa rozširuje pôsobnosť pravidiel obsiahnutých v Bruselskom dohovore z roku 1968 na niektoré členské štáty Európskeho združenia voľného obchodu</xsl:text></span><div class=\"fieldContent\"><div class=\"HtmlVisualizationWithDiv contentVis wordwrap\"></div></div></xsl:template><xsl:template name=\"lbl_Poznamka3\"><span class=\"fieldLabel\" title=\"\"   style=\"width:870px;\"><xsl:text disable-output-escaping=\"yes\">3) Napríklad § 67 ods. 4 zákona č.97/1963 Zb. o medzinárodnom práve súkromnom a procesnom v znení neskorších predpisov&lt;br/&gt; 4) Napríklad nariadenie Európskeho parlamentu a Rady (EÚ) č.1215/2012 z 12. decembra 2012 o právomoci a o uznávaní a výkone rozsudkov v občianskych a obchodných veciach (prepracované znenie) (Ú.v. EÚ L351, 20. 12. 2012) v platnom znení, nariadenie Európskeho parlamentu a Rady (ES) č.805/2004 z 21. apríla 2004, ktorým sa vytvára európsky exekučný titul pre nesporné nároky (Ú.v. EÚ L143, 30. 4. 2004) v platnom znení, nariadenie Európskeho parlamentu a Rady (ES) č. 896/2006 z 12. decembra 2006, ktorým sa zavádza európske konanie o platobnom rozkaze (Ú.v. EÚ L399, 30. 12. 2006) v platnom znení, nariadenie Európskeho parlamentu a Rady (ES) č.861/2007 z 11. júla 2007, ktorým sa ustanovuje Európske konanie vo veciach s nízkou hodnotou sporu (Ú.v. EÚ L 199, 31. 7. 2007) v platnom znení, nariadenie Európskeho parlamentu a Rady (EÚ) č. 606/2013 z 12. júna 2013 o vzájomnom uznávaní ochranných opatrení v občianskych veciach (Ú.v. EÚ L 181, 29. 6. 2013)</xsl:text></span><div class=\"fieldContent\"><div class=\"HtmlVisualizationWithDiv contentVis wordwrap\"></div></div></xsl:template><xsl:template name=\"oznacenieExekucnehoTituluSekcia\"><div id=\"layoutRow6795\" class=\"layoutRow ui-tabs ui-widget-content   backGroundColorTretiaUroven \"     title=\"\" ><xsl:attribute name=\"id\">layoutRow6795<xsl:text>_Repeating_</xsl:text><xsl:number level=\"any\" format=\"1\"/></xsl:attribute><input type=\"hidden\" name=\"oznacenieExekucnehoTituluSekcia\" id=\"oznacenieExekucnehoTituluSekcia\" ><xsl:attribute name=\"id\">oznacenieExekucnehoTituluSekcia<xsl:text>_Repeating_</xsl:text><xsl:number level=\"any\" format=\"1\"/></xsl:attribute></input><div class=\"caption ui-widget-header\"><div class=\"headercorrection\" title=\"Označenie exekučného titulu\">Označenie exekučného titulu</div><span class=\"arrow ui-icon ui-icon-carat-1-n\">&#xa0;</span></div><div id=\"layoutRowContentlayoutRow6795\" class=\"columns\"><xsl:attribute name=\"id\">layoutRowContentlayoutRow6795<xsl:text>_Repeating_</xsl:text><xsl:number level=\"any\" format=\"1\"/></xsl:attribute><div id=\"layoutColumn10424\" class=\"column first\" ><xsl:attribute name=\"id\">layoutColumn10424<xsl:text>_Repeating_</xsl:text><xsl:number level=\"any\" format=\"1\"/></xsl:attribute><div id=\"layoutCell23565\" class=\"cell  cellBussiness  sirokyTextBox570px\" ><xsl:attribute name=\"id\">layoutCell23565<xsl:text>_Repeat