e=\"formatTimeTrimMinutes\"><xsl:param name=\"time\" /><xsl:variable name=\"timeString\" select=\"string($time)\" /><xsl:if test=\"$timeString != ''\"><xsl:value-of select=\"substring($timeString, 1, 5)\" /></xsl:if></xsl:template><xsl:template name=\"formatToSkDateTime\"><xsl:param name=\"dateTime\" /><xsl:variable name=\"dateSubstring\" select=\"substring($dateTime, 1, 10)\" /><xsl:variable name=\"timeSubstring\" select=\"substring($dateTime, 12, 8)\" /><xsl:variable name=\"dateString\"><xsl:choose><xsl:when test=\"$dateSubstring != '' and string-length($dateSubstring)=10 and string(number(substring($dateSubstring, 1, 4))) != 'NaN' \"><xsl:value-of select=\"concat(substring($dateSubstring, 9, 2), '.', substring($dateSubstring, 6, 2), '.', substring($dateSubstring, 1, 4))\" /></xsl:when><xsl:otherwise><xsl:value-of select=\"$dateSubstring\"></xsl:value-of></xsl:otherwise></xsl:choose></xsl:variable><xsl:variable name=\"timeString\"><xsl:if test=\"$timeSubstring != ''\"><xsl:value-of select=\"substring($timeSubstring, 1, 5)\" /></xsl:if></xsl:variable><xsl:value-of select=\"concat($dateString,' ',$timeString)\"/></xsl:template><xsl:template name=\"formatToSkDate\"><xsl:param name=\"date\" /><xsl:variable name=\"dateString\" select=\"string($date)\" /><xsl:choose><xsl:when test=\"$dateString != '' and string-length($dateString)=10 and string(number(substring($dateString, 1, 4))) != 'NaN' \"><xsl:value-of select=\"concat(substring($dateString, 9, 2), '.', substring($dateString, 6, 2), '.', substring($dateString, 1, 4))\" /></xsl:when><xsl:otherwise><xsl:value-of select=\"$dateString\"></xsl:value-of></xsl:otherwise></xsl:choose></xsl:template><xsl:template name=\"formatAnyUri\"><xsl:param name=\"anyUri\" /><xsl:variable name=\"anyUriString\" select=\"string($anyUri)\" /><xsl:variable name=\"anyUriSubString\"><xsl:choose><xsl:when test=\"$anyUriString != '' and contains($anyUriString, 'mailto:') and contains($anyUriString, '@')\"><xsl:value-of select=\"substring($anyUriString, 8, string-length($anyUriString))\" /></xsl:when><xsl:when test=\"$anyUriString != '' and contains($anyUriString, 'http://')\"><xsl:value-of select=\"substring($anyUriString, 8, string-length($anyUriString))\" /></xsl:when><xsl:when test=\"$anyUriString != '' and contains($anyUriString, 'https://')\"><xsl:value-of select=\"substring($anyUriString, 9, string-length($anyUriString))\" /></xsl:when><xsl:otherwise><xsl:value-of select=\"$anyUriString\"></xsl:value-of></xsl:otherwise></xsl:choose></xsl:variable><xsl:value-of select=\"$anyUriSubString\"/></xsl:template><xsl:template name=\"string-replace-all\"><xsl:param name=\"text\"/><xsl:param name=\"replace\"/><xsl:param name=\"by\"/><xsl:choose><xsl:when test=\"contains($text, $replace)\"><xsl:value-of select=\"substring-before($text,$replace)\"/><xsl:value-of select=\"$by\"/><xsl:call-template name=\"string-replace-all\"><xsl:with-param name=\"text\" select=\"substring-after($text,$replace)\"/><xsl:with-param name=\"replace\" select=\"$replace\"/><xsl:with-param name=\"by\" select=\"$by\" /></xsl:call-template></xsl:when><xsl:otherwise><xsl:value-of select=\"$text\"/></xsl:otherwise></xsl:choose></xsl:template><xsl:template name=\"booleanToSkString\"><xsl:param name=\"boolValue\" /><xsl:variable name=\"boolValueString\" select=\"string($boolValue)\" /><xsl:choose><xsl:when test=\"$boolValueString = 'true' \"><xsl:text>Áno</xsl:text></xsl:when><xsl:when test=\"$boolValueString = '1' \"><xsl:text>Áno</xsl:text></xsl:when><xsl:when test=\"$boolValueString = 'false' \"><xsl:text>Nie</xsl:text></xsl:when><xsl:when test=\"$boolValueString = '0' \"><xsl:text>Nie</xsl:text></xsl:when><xsl:otherwise><xsl:value-of select=\"$boolValueString\"></xsl:value-of></xsl:otherwise></xsl:choose></xsl:template><xsl:decimal-format name=\"european\" decimal-separator=',' grouping-separator='&#160;' /></xsl:stylesheet>",
